import React from 'react';
import ReactDOM from 'react-dom';
import { TextField, FormControl, makeStyles } from '@material-ui/core'

const useStyles = makeStyles(theme => ({
    root: {
        '& > *': {
            margin: theme.spacing(1),
            width: 200
        }
    }
}));

function Form() {
    const classes = useStyles();
    return (
        <form className={classes.root}>
            <div>
                <TextField id="fname" label="First Name" variant="outlined"/>
                <TextField id="lname" label="Last Name" variant="outlined"/>
            </div>
            <div>
                <TextField id="email" label="Email" variant='standard'></TextField>
            </div>
        </form>
    );
}


export default Form;
